const Naina=()=>{
    
const [current,setvalue]=useState(0);
const Jaya=()=>{
    setvalue(current+1);
};
return(
    <>
        <h1>{current}</h1>
        <button onClick={Jaya}>Click Me!</button>
    </>
);
}
export default Naina;
